        /**

        function encrypt(content, key, iv) {
            let encrypted = '';
            let _content = CryptoJS.enc.Utf8.parse(content);

            let _iv = CryptoJS.enc.Utf8.parse(iv);

            })

        function decrypt(content, key, iv) {

        /**

        function randomString(num) {
            num = num || 0x20; // 左操作数为假值时，返回右操作数，否则返回左操作数
            const seed = 'ABCDEFGHJKMNPQRSTWXYZabcdefhijkmnprstwxyz2345678';
            let length = seed.length;
            let s = '';
            for (let i = 0; i < num; i++) {

                s += seed.charAt(Math.floor(number));
            }
            console.log(s);
